import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  width: 100%;
  height: 1446px;
  background-color: #f8f8f8;
  & > div {
    box-sizing: border-box;
    width: 993px;
    margin: 0 auto;
    height: 100%;
  }
`;
function Bottom() {
  return (
    <Wrapper>
      <div></div>
    </Wrapper>
  );
}

export default Bottom;
